    public boolean isIsomorphic2(String s, String t) {
        int sLen = s.length();
        assert sLen == t.length();
        int [] sMap = new int[256];
        int [] tMap = new int[256];
        char sChar, tChar;
        int i = 0;
        while(i < sLen){
            sChar = s.charAt(i);
            tChar = t.charAt(i);
            if (sMap[sChar] != tMap[tChar]) {
                return false;
            }
            i++;    // 先++再设置map里的值,因为map数组元素的初始值为0
            sMap[sChar] = i;
            tMap[tChar] = i;
        }
        return true;
    }
